import "./App.css";
import { BrowserRoute as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="app-container">
      <h1>Hello</h1>

      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
